import itertools
import timeit


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        bigger = 0
        list_letters = list(s)
        for i in range(0, len(list_letters)):
            for j in range(len(list_letters), 0, -1):
                elements = list_letters[i:j]
                if elements:
                    len_element = len(elements)
                    if len_element == len(set(elements)) and len_element > bigger:
                        bigger = len_element
                        break
        return bigger


